In a 2018 retrospective, Sports Illustrated called the 1998 Vikings "The Greatest Team Never to Make It." The loss had a dramatic effect on Minnesota sports culture, as the 1998 Vikings were considered the team most likely to deliver a Super Bowl championship to a franchise that had already suffered multiple heartbreaking defeats. Numerous publications have noted the influence that the loss had on the Vikings fan base; 

 The previous playoff meeting between the two teams was the 2009 NFC Championship game, which was notable for the excessive roughness of the Saints, later termed "Bountygate," as well as the Vikings driving close to a game-winning field goal before quarterback Brett Favre threw an interception. Prior to the 2016 season, Minnesota's starting quarterback Teddy Bridgewater suffered a non-contact injury that produced a dislocated knee, torn ACL and "other structural damage." The Vikings began 2016 with a 5–0 record before 

 a 3-yard run in the 2nd quarter. On December 29, 2013, the Vikings played their final game at the Metrodome, a 14–13 victory over the Detroit Lions. The team's record at the dome was 162–88 in the regular season and 6–4 in playoff games. This year's NFC Championship Game is also dubbed by many as the "Bountygate Game" that also resulted in several players and coaching staff (including head coach Sean Payton) receiving 12-month suspensions three years later. The Vikings had 10 Pro Bowlers and four All-Pros on their roster, both league-highs for the season.
